// redux/h4TextAnimate.js.js
import { createSlice } from '@reduxjs/toolkit';

const initialState = {
    h4TextAnimate: {},
};

export const h4TextAnimateSlice = createSlice({
    name: 'h4TextAnimate',
    initialState,
    reducers: {
        setH4TextAnimate: (state, action) => {
            state.h4TextAnimate = action.payload;
        },
    },
});

export const { setH4TextAnimate } = h4TextAnimateSlice.actions;

export default h4TextAnimateSlice.reducer;
